CKEDITOR.plugins.setLang("a11yhelp","pl",{title:"Instrukcje dotycz\u0105ce dost\u0119pno\u015bci",contents:"Zawarto\u015b\u0107 pomocy. Wci\u015bnij ESC, aby zamkn\u0105\u0107 to okno.",legend:[{name:"Informacje og\xf3lne",items:[{name:"Pasek narz\u0119dzi edytora",legend:"Naci\u015bnij ${toolbarFocus}, by przej\u015b\u0107 do paska narz\u0119dzi. Przejd\u017a do nast\u0119pnej i poprzedniej grupy narz\u0119dzi u\u017cywaj\u0105c TAB oraz SHIFT+TAB. Przejd\u017a do nast\u0119pnego i poprzedniego przycisku paska narz\u0119dzi za pomoc\u0105 STRZA\u0141KI W PRAWO lub STRZA\u0141KI W LEWO. Naci\u015bnij SPACJ\u0118 lub ENTER by aktywowa\u0107 przycisk paska narz\u0119dzi."},{name:"Okno dialogowe edytora",legend:"Wewn\u0105trz okna dialogowego naci\u015bnij TAB, by przej\u015b\u0107 do kolejnego elementu tego okna lub SHIFT+TAB, by przej\u015b\u0107 do poprzedniego elementu okna. Naci\u015bnij ENTER w celu zatwierdzenia opcji okna dialogowego lub ESC w celu anulowania zmian. Je\u015bli okno dialogowe ma kilka zak\u0142adek, do listy zak\u0142adek mo\u017cna przej\u015b\u0107 za pomoc\u0105 ALT+F10 lub TAB. Gdy lista zak\u0142adek jest aktywna, mo\u017cesz przej\u015b\u0107 do kolejnej i poprzedniej zak\u0142adki za pomoc\u0105 STRZA\u0141KI W PRAWO i STRZA\u0141KI W LEWO."},{name:"Menu kontekstowe edytora",legend:"Wci\u015bnij ${contextMenu} lub PRZYCISK APLIKACJI aby otworzy\u0107 menu kontekstowe. Przejd\u017a do nast\u0119pnej pozycji menu wciskaj\u0105c TAB lub STRZA\u0141K\u0118 W D\xd3\u0141. Przejd\u017a do poprzedniej pozycji menu wciskaj\u0105c SHIFT + TAB lub STRZA\u0141K\u0118 W G\xd3R\u0118. Wci\u015bnij SPACJ\u0118 lub ENTER aby wygra\u0107 pozycj\u0119 menu. Otw\xf3rz pod-menu obecnej pozycji wciskaj\u0105c SPACJ\u0118 lub ENTER lub STRZA\u0141K\u0118 W PRAWO. Wr\xf3\u0107 do pozycji nadrz\u0119dnego menu wciskaj\u0105c ESC lub STRZA\u0141K\u0118 W LEWO. Zamknij menu wciskaj\u0105c ESC."},{name:"Lista w edytorze",legend:"Wewn\u0105trz listy przejd\u017a do kolejnego elementu listy za pomoc\u0105 przycisku TAB lub STRZA\u0141KI W D\xd3\u0141. Przejd\u017a do poprzedniego elementu listy za pomoc\u0105 SHIFT+TAB lub STRZA\u0141KI W G\xd3R\u0118. Naci\u015bnij SPACJ\u0118 lub ENTER w celu wybrania opcji z listy. Naci\u015bnij ESC, by zamkn\u0105\u0107 list\u0119."},{name:"Pasek \u015bcie\u017cki element\xf3w edytora",legend:"Naci\u015bnij ${elementsPathFocus} w celu przej\u015bcia do paska \u015bcie\u017cki element\xf3w edytora. W celu przej\u015bcia do kolejnego elementu naci\u015bnij klawisz TAB lub STRZA\u0141KI W PRAWO. W celu przej\u015bcia do poprzedniego elementu naci\u015bnij klawisze SHIFT+TAB lub STRZA\u0141KI W LEWO. By wybra\u0107 element w edytorze, u\u017cyj klawisza SPACJI lub ENTER."}]},{name:"Polecenia",items:[{name:"Polecenie Cofnij",legend:"Naci\u015bnij ${undo}"},{name:"Polecenie Pon\xf3w",legend:"Naci\u015bnij ${redo}"},{name:"Polecenie Pogrubienie",legend:"Naci\u015bnij ${bold}"},{name:"Polecenie Kursywa",legend:"Naci\u015bnij ${italic}"},{name:"Polecenie Podkre\u015blenie",legend:"Naci\u015bnij ${underline}"},{name:"Polecenie Wstaw/ edytuj odno\u015bnik",legend:"Naci\u015bnij ${link}"},{name:"Polecenie schowaj pasek narz\u0119dzi",legend:"Naci\u015bnij ${toolbarCollapse}"},{name:"Przejd\u017a do poprzedniego miejsca, w kt\xf3rym mo\u017cna ustawi\u0107 focus",legend:"Naci\u015bnij ${accessPreviousSpace}, aby przej\u015b\u0107 do najbli\u017cszego niedost\u0119pnego miejsca przed kursorem, w kt\xf3rym mo\u017cna ustawi\u0107 focus. Przyk\u0142ad: dwa przylegaj\u0105ce elementy HR. Powt\xf3rz ten skr\xf3t klawiaturowy, by dotrze\u0107 do kolejnych takich miejsc."},{name:"Przejd\u017a do nast\u0119pnego miejsca, w kt\xf3rym mo\u017cna ustawi\u0107 focus",legend:"Naci\u015bnij ${accessNextSpace}, aby przej\u015b\u0107 do najbli\u017cszego niedost\u0119pnego miejsca po kursorze, w kt\xf3rym mo\u017cna ustawi\u0107 focus. Przyk\u0142ad: dwa przylegaj\u0105ce elementy HR. Powt\xf3rz ten skr\xf3t klawiaturowy, by dotrze\u0107 do kolejnych takich miejsc."},{name:"Pomoc dotycz\u0105ca dost\u0119pno\u015bci",legend:"Naci\u015bnij ${a11yHelp}"},{name:"Wklej jako tekst",legend:"Naci\u015bnij ${pastetext}",legendEdge:"Naci\u015bnij ${pastetext}, a nast\u0119pnie ${paste}"}]}],tab:"Tab",pause:"Pause",capslock:"Caps Lock",escape:"Escape",pageUp:"Page Up",pageDown:"Page Down",leftArrow:"Strza\u0142ka w lewo",upArrow:"Strza\u0142ka w g\xf3r\u0119",rightArrow:"Strza\u0142ka w prawo",downArrow:"Strza\u0142ka w d\xf3\u0142",insert:"Insert",leftWindowKey:"Lewy klawisz Windows",rightWindowKey:"Prawy klawisz Windows",selectKey:"Klawisz wyboru",numpad0:"Klawisz 0 na klawiaturze numerycznej",numpad1:"Klawisz 1 na klawiaturze numerycznej",numpad2:"Klawisz 2 na klawiaturze numerycznej",numpad3:"Klawisz 3 na klawiaturze numerycznej",numpad4:"Klawisz 4 na klawiaturze numerycznej",numpad5:"Klawisz 5 na klawiaturze numerycznej",numpad6:"Klawisz 6 na klawiaturze numerycznej",numpad7:"Klawisz 7 na klawiaturze numerycznej",numpad8:"Klawisz 8 na klawiaturze numerycznej",numpad9:"Klawisz 9 na klawiaturze numerycznej",multiply:"Przemn\xf3\u017c",add:"Plus",subtract:"Minus",decimalPoint:"Separator dziesi\u0119tny",divide:"Podziel",f1:"F1",f2:"F2",f3:"F3",f4:"F4",f5:"F5",f6:"F6",f7:"F7",f8:"F8",f9:"F9",f10:"F10",f11:"F11",f12:"F12",numLock:"Num Lock",scrollLock:"Scroll Lock",semiColon:"\u015arednik",equalSign:"Znak r\xf3wno\u015bci",comma:"Przecinek",dash:"Pauza",period:"Kropka",forwardSlash:"Uko\u015bnik prawy",graveAccent:"Akcent s\u0142aby",openBracket:"Nawias kwadratowy otwieraj\u0105cy",backSlash:"Uko\u015bnik lewy",closeBracket:"Nawias kwadratowy zamykaj\u0105cy",singleQuote:"Apostrof"});